import React from 'react';
import { Button } from 'reactstrap';

function Landing() {
    return(
        <div className='container'>
            <div className='col p-0 m-1 mt-5'>
                <h4> Chulalongkorn University </h4>
                <h4> Sports Complex </h4>
            </div>
            <div>
                <img src='..public/assets/image1' />
            </div>
            <div className='col mb-3 fixed-bottom'>
                <a className='btn btn-dark btn-lg col' role='button'> Enter Sports Complex </a>
            </div>

        </div>
    )
}

export default Landing;
